import React from "react";

function Booktoggler(props) {
    let whichOne;
    if (props.isLoggedIn) {
         whichOne = <h1 onClick={this.handleViewSearchClick}>View Search Button</h1>;
    } else {
        whichOne = <h1 onClick={this.handleViewSavedClick}>View Saved Button</h1>;
    }

    return <Booktoggler>{whichOne}</Booktoggler>;


}

export default Booktoggler;
